E_D("replace into `phome_ecms_game` values('923','5','0','','','','1','admin','','1','0','1343190023','0','0','0','0','','','923','0','0','0','0','0','0','星猫历险记之国画篇','1343190023','/spic/20120725/839.jpg','0','1','1343190023','0','3','1','0','','0','','','667','479','星猫率领12星座和黑魔王带领的黑暗势力在华山之颠展开秘密激战，双方大战几百回合，星猫和12星座被逼到山崖边，险象重生。此时恰巧遇见一名老学者在晒被淋湿的名画《清明上河图》，画面和谐繁荣的气氛令星猫和他的伙伴们立刻能量大增，打出的绝招中融合了画的力量，绝招幻化做超级武器，大挫黑魔王与其党羽，最后黑魔王只身一人遁逃而去。这次较量使黑魔王意识到《清明上河图》所蕴涵的强大“精神之光”，于是命小黑怪研究《清明上河图》。可惜小黑怪心灵并未进化，无法研究出其中奥秘，却误打误撞发现除《清明上河图》以外的很多名画都蕴涵强大“精神之光”，于是便密谋从《清明上河图》开始下手，回到中国古代去阻挠画家创作古画。幸得星猫和12星座及时发现，为了暗中保护画家和关联景物，星猫一行秘密回到古代中国，并结识了张择端等画家，与他们共同经历了名画的创作经历。同时，星猫和12星座战斗力也大大提升，而黑魔王不但再次宣告失败，可怜的小黑怪还被永远地留在了古代……','1','','0','','1','/dpic/20120725/840.jpg','582','/donghuapian/582/1.html, /donghuapian/582/2.html, /donghuapian/582/3.html, /donghuapian/582/4.html, /donghuapian/582/5.html, /donghuapian/582/6.html, /donghuapian/582/7.html, /donghuapian/582/8.html, /donghuapian/582/9.html, /donghuapian/582/10.html, /donghuapian/582/11.html, /donghuapian/582/12.html, /donghuapian/582/13.html, /donghuapian/582/14.html, /donghuapian/582/15.html, /donghuapian/582/16.html, /donghuapian/582/17.html, /donghuapian/582/18.html, /donghuapian/582/19.html, /donghuapian/582/20.html, /donghuapian/582/21.html, /donghuapian/582/22.html, /donghuapian/582/23.html, /donghuapian/582/24.html, /donghuapian/582/25.html, /donghuapian/582/26.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0196.jpg','http://www.61baobao.com/donghuapian/pic/05/0196.jpg','0','三个月以上','26','qiyi,69b20e8aa28a407a84317083442abcb4|||qiyi,537b548c66a24fed84b8f30c94d3adcc|||qiyi,1e6f2bef96b744d2bc377f61ee0252ad|||qiyi,0c0e014c82d84201b86e6ccd8d98684b|||qiyi,f8477263178a49a6a39d2a93fce0eb6f|||qiyi,0e1cdda4a90e4166a92645df1c380bf6|||qiyi,e79c3ae327fd458ba592c0238e76125e|||qiyi,5fdc28d6a08c4e9da735e9f2f0036c7a|||qiyi,9c78ec6fd6084d598df5bd2cafd8d715|||qiyi,3fbbdf9be70841b1aec34c7590c70d8b|||qiyi,b608776b652f49b7b3ef48839d012adb|||qiyi,e41aad297dc44957