E_D("replace into `phome_ecms_game` values('965','5','0','','','','1','admin','','1','0','1343190081','0','0','0','0','','','965','0','0','0','0','0','0','红色传奇','1343190081','/spic/20120725/921.jpg','0','1','1343190081','0','3','1','0','','0','','','667','479','《红色传奇》根据《铁匠的儿子》、《龙舟战鼓》、《小铁头夺马记》、《石头娃子》等十个真实的革命故事进行改编，加入许多现代戏剧元素。<br />','1','','0','','1','/dpic/20120725/922.jpg','367','/donghuapian/367/1.html, /donghuapian/367/2.html, /donghuapian/367/3.html, /donghuapian/367/4.html, /donghuapian/367/5.html, /donghuapian/367/6.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/023.jpg','http://www.61baobao.com/donghuapian/pic/05/023.jpg','0','三个月以上','6','cntv,449087a9e803445ebc32a589106ab76c|||cntv,168c78cc5d61437d80cd7aa9bd8034ae|||cntv,006ed3da8fda40f6832aff0e2c33f56a|||cntv,5c65276664ad429298118172a015fe17|||cntv,8aca6070dbfe4d2ca1497cb73d8538ea|||cntv,3511ab8dc8064a3291d0f1c09b457fc9|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('966','5','0','','','','1','admin','','1','0','1343190085','0','0','0','0','','','966','0','0','0','0','0','0','幻想曲','1343190085','/spic/20120725/925.jpg','0','1','1343190085','0','3','1','0','','0','','','667','479','幻想曲是影坛首次尝试将音乐和美术所作的一次伟大的结合，以美术来诠译音乐，使得动画片的走向更加多元，而且本片还是世界第一部立体音响的电影，在影史上占有非常重要的地位。本片由古典音乐与动画所搭配而成，大致上可分成“故事音乐”、“无特定主题音乐”和“交响乐”等三大类，除了由米奇主演的“魔法师的徒弟”外，其它六个段落都无剧情，纯粹在表现影像与音乐的巧妙配合而已，一团色彩或线条可能暗喻某些概念。','1','','0','','1','/dpic/20120725/926.jpg','398','/donghuapian/398/1.html, /donghuapian/398/2.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/053.jpg','http://www.61baobao.com/donghuapian/pic/05/053.jpg','0','三个月以上','2','cntv,2ca61657e8f640b9281c1ba001543729|||cntv,0bd47aac9ad34678a9901391865a0e9a|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('967','5','0','','','','1','admin','','1','0','1343190086','0','0','0','0','','','967','0','0','0','0','0','0','麦兜故事','1343190086','/spic/20120725/919.jpg','0','1','1343190086','0','3','1','0','','0','','','667','479','这是关于九龙大角咀猪样小朋友麦兜的成长故事，由他的出生、上幼儿园、上中学、再讲讲讲讲，到负家产的故事。麦兜单纯乐观、资质平平，却有很多梦想。麦太是单亲妈妈，把所有梦想寄托在儿子身上。希望、失望、希望、失望……一个一个的，都是失败，但麦兜还是凭着他正直善良的“死蠢”，创造了他美丽的世界…… 详细>>','1','','0','','1','/dpic/20120725/920.jpg','102','/donghuapian/102/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/92.jpg','http://www.61baobao.com/donghuapian/pic/92.jpg','0','三个月以上','1','sohu,32155|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('968','5','0','','','','1','admin','','1','0','1343190088','0','0','0','0','','','968','0','0','0','0','0','0','小瑞与大魔王','1343190088','/spic/20120725/929.jpg','0','1','1343190088','0','3','1','0','','0','','','667','479','在很久很久以前，宁静的歌谣森林里，有一个宁静的小村庄——洛可可。麒麟神兽小瑞就生活在这里，陪伴他的是他的传家宝——神奇魔盘，还有四个活泼勇敢的小伙伴。在遥远的地方，有一个思想单一的制作天才——大魔王，他一心想统治世界，得到全世界最好玩的玩具。他凭借自己天才的头脑建造了一座可以移动的“玩具城堡”，把他所有的奇思妙想都装在了里面。然而这天，大魔王遇到了难题——他已经没有足够的能量支撑城堡运动了，与此同时，长期不运动使他得了肥胖症。为了治疗肥胖症，他用仅剩的能量将玩具城堡开到了歌谣森林，他立志要夺取传说中生长在洛可可村的圣果“贪吃果”，并用它的神奇力量恢复自己的体型……','1','','0','','1','/dpic/20120725/930.jpg','683','/donghuapian/683/1.html, /donghuapian/683/2.html, /donghuapian/683/3.html, /donghuapian/683/4.html, /donghuapian/683/5.html, /donghuapian/683/6.html, /donghuapian/683/7.html, /donghuapian/683/8.html, /donghuapian/683/9.html, /donghuapian/683/10.html, /donghuapian/683/11.html, /donghuapian/683/12.html, /donghuapian/683/13.html, /donghuapian/683/14.html, /donghuapian/683/15.html, /donghuapian/683/16.html, /donghuapian/683/17.html, /donghuapian/683/18.html, /donghuapian/683/19.html, /donghuapian/683/20.html, /donghuapian/683/21.html, /donghuapian/683/22.html, /donghuapian/683/23.html, /donghuapian/683/24.html, /donghuapian/683/25.html, /donghuapian/683/26.html, /donghuapian/683/27.html, /donghuapian/683/28.html, /donghuapian/683/29.html, /donghuapian/683/30.html, /donghuapian/683/31.html, /donghuapian/683/32.html, /donghuapian/683/33.html, /donghuapian/683/34.html, /donghuapian/683/35.html, /donghuapian/683/36.html, /donghuapian/683/37.html, /donghuapian/683/38.html, /donghuapian/683/39.html, /donghuapian/683/40.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0286.jpg','http://www.61baobao.com/donghuapian/pic/05/0286.jpg','0','三个月以上','40','cntv,628410cb242542bc83bbe4a9a11d944b|||cntv,f0f15803737848e59e606a26b9135d5a|||cntv,0c84b579b3e6421984ba9ebb70f3317c|||cntv,0f9790fa9b4a41ea9eb0868df39c79bd|||cntv,76b3d84a3e814eb5882164f6dc89cbb0|||cntv,a932cfe213dc4c77a686b406