E_D("replace into `phome_ecms_game` values('974','5','0','','','','1','admin','','1','0','1343190096','0','0','0','0','','','974','0','0','0','0','0','0','会摇尾巴的狼','1343190096','/spic/20120725/943.jpg','0','1','1343190096','0','3','1','0','','0','','','667','479','一只狼掉到陷阱里去了，怎么跳也跳不出来。后来，一只老山羊慢慢走过来了，狼连忙向老山羊打招呼：“好朋友！为了友情的缘故，帮帮忙吧！”老山羊问：“你是谁？为什么跑到猎人安下的陷阱里去了？”狼立刻装出一副又老实又可怜的模样，说：“我，你不认识吗？一只又忠诚又驯良的狗啊，为了援救一只掉到陷阱里的小鸡，我不顾一切，牺牲自己，一下跳了进来，就再也出不去了。唉！可怜可怜我这只善良的老狗吧！” ','1','','0','','1','/dpic/20120725/944.jpg','607','/donghuapian/607/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0221.jpg','http://www.61baobao.com/donghuapian/pic/05/0221.jpg','0','三个月以上','1','qiyi,e70b93db8e21466aaf51e17a4a7acfc6|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('975','5','0','','','','1','admin','','1','0','1343190096','0','0','0','0','','','975','0','0','0','0','0','0','我的家园','1343190096','/spic/20120725/947.jpg','0','1','1343190096','0','3','1','0','','0','','','667','479','迪尼亚城市里有一座名叫拉拍德拉的大楼，里面住着几个活泼可爱的小朋友，他们是吴刚、陆新和孟光，这三个小孩天真活泼而又想象力丰富，还经常喜欢恶作剧。不幸的是这座大楼屋顶上的有一个居心不良的烟筒，总想对大楼进行破坏，他还不时与女巫宋琳艳狼狈爲奸。远在城市之外的宋琳艳野心勃勃，策划了一次又一次的侵略，企图统治高迪尼亚。滑稽矮小的马林、蠢顿的飞象队、怪异的哈哈龙以及阴险狡诈的毒蛇等等都是宋琳艳的手下兵将，他们在邪恶的宋琳艳的领导下，与小朋友频频展开较量，其中发生了不少惊险有趣的故事。','1','','0','','1','/dpic/20120725/948.jpg','556','/donghuapian/556/1.html, /donghuapian/556/2.html, /donghuapian/556/3.html, /donghuapian/556/4.html, /donghuapian/556/5.html, /donghuapian/556/6.html, /donghuapian/556/7.html, /donghuapian/556/8.html, /donghuapian/556/9.html, /donghuapian/556/10.html, /donghuapian/556/11.html, /donghuapian/556/12.html, /donghuapian/556/13.html, /donghuapian/556/14.html, /donghuapian/556/15.html, /donghuapian/556/16.html, /donghuapian/556/17.html, /donghuapian/556/18.html, /donghuapian/556/19.html, /donghuapian/556/20.html, /donghuapian/556/21.html, /donghuapian/556/22.html, /donghuapian/556/23.html, /donghuapian/556/24.html, /donghuapian/556/25.html, /donghuapian/556/26.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0170.jpg','http://www.61baobao.com/donghuapian/pic/05/0170.jpg','0','三个月以上','26','qiyi,4e3b7ec0e502496abae9f2b315b6df71|||qiyi,dd12dc484e354818ae182c856f291692|||qiyi,76f873ef7b4d40348b29e567873412be|||qiyi,cfb5d0af324c4de3a8cb79fd83b7ba24|||qiyi,73eca06ec79f42ba8191374c9b477e97|||qiyi,59ce1dfaea644732a413f91fa640407f|||qiyi,cc2140d470fe487fb6e3760694e0104b|||qiyi,e3116146a0df42cdbdec4cc534361315|||qiyi,b6967ff99d8446ae836e7cc8485f8062|||qiyi,6d0592ff97884433b6991c0ca4e0edcd|||qiyi,f0b5025779c94467a2dbb648ec07fd57|||qiyi,b5951204a35a4f9fa49fa1baf5fa0a53|||qiyi,75ffc77414354920859b47067e77a468|||qiyi,a5796038e66d49e4b943c5650d83fd27|||qiyi,c5f456cc598c49cb98df91fd7c5d35d2|||qiyi,c1fdaab91a464d2296f871f301c7ad01|||q