E_D("replace into `phome_ecms_game` values('1020','5','0','','','','1','admin','','1','0','1343190141','0','0','0','0','','','1020','0','0','0','0','0','0','风中奇缘','1343190141','/spic/20120725/1021.jpg','0','1','1343190141','0','3','1','0','','0','','','667','479','在勇敢的上尉庄迈斯率领下，一批来自英国拓荒者到达了美洲大陆，敲响了美丽的印第安公主宝嘉康蒂和她族人们的警钟，也开始了一个建立在欢笑、爱和忠诚上的故事。可爱的浣熊米糕和小蜂鸟菲莉快乐地穿梭其间：宝嘉康蒂面临改变一生的决定，又必须避免两军冲突，在充满智慧的柳树婆婆帮助下，她学会了倾听自己心中的声音，并且随著风中的色彩去追寻人生的真谛……','1','','0','','1','/dpic/20120725/1022.jpg','704','/donghuapian/704/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/04.jpg','http://www.61baobao.com/donghuapian/pic/07/04.jpg','0','三个月以上','1','cntv,94dc3990b2734d7d90ab185c1968a9b0|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1021','5','0','','','','1','admin','','1','0','1343190142','0','0','0','0','','','1021','0','0','0','0','0','0','夸口的青蛙','1343190142','/spic/20120725/1017.jpg','0','1','1343190142','0','3','1','0','','0','','','667','479','有一只骄傲的青蛙喜欢自夸，自称跳高冠军，为了显示自己的本领，它自不量力，竟敢与小白兔赛跑。赛跑开始了，眼看小白兔超过了它，它怕失败，半途又提出和小白兔比赛爬树，小白兔不会爬，青蛙就在它面前夸耀自己的本领大，这下激怒了一旁的小松鼠，小松鼠主动要和青蛙比赛爬树。青蛙爬不过小松鼠，但又不服气，说小松鼠没什么了不起，不能上天，小松鼠反问它：“你能上天吗？”，听后它居然吹嘘自己能飞上天，大家听了觉得十分可笑。','1','','0','','1','/dpic/20120725/1018.jpg','606','/donghuapian/606/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0220.jpg','http://www.61baobao.com/donghuapian/pic/05/0220.jpg','0','三个月以上','1','qiyi,faf964cd764c4c52b729f32888ff7684|||','0','','0','0','0');");
