E_D("replace into `phome_ecms_game` values('1023','5','0','','','','1','admin','','1','0','1343190143','0','0','0','0','','','1023','0','0','0','0','0','0','悬崖上的金鱼公主','1343190143','/spic/20120725/1023.jpg','0','1','1343190143','0','3','1','0','','0','','','667','479','《悬崖上的金鱼公主》（崖の上のポニョ，又译崖上的波儿，崖上的波妞）是日本吉卜力工作室在2008制作的剧场版动画片。这部电影的主人公宗介的原型就是宫崎骏的大儿子宫崎吾郎。本片表达了他们父子两个人的深情。<br />  《悬崖上的金鱼公主》（崖の上のポニョ，又译崖上的波儿，崖上的波妞）是日本吉卜力工作室在2008制作的剧场版动画片。这部电影的主人公宗介的原型就是宫崎骏的大儿子宫崎吾郎。本片表达了他们父子两个人的深情。海量视频尽在CNTV动画台。<br />','1','','0','','1','/dpic/20120725/1024.jpg','483','/donghuapian/483/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0126.jpg','http://www.61baobao.com/donghuapian/pic/05/0126.jpg','0','三个月以上','1','cntv,7CCE52E605F4412292935A8177EB7488|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1024','5','0','','','','1','admin','','1','0','1343190144','0','0','0','0','','','1024','0','0','0','0','0','0','巨虫公园','1343190144','/spic/20120725/1027.jpg','0','1','1343190144','0','3','1','0','','0','','','667','479','巨虫公园讲述的是三个孩子在暑期登上一艘游轮，航行途中被不明生物从船上带离，流落到茫茫大海中央一座荒岛上。这座神秘岛屿充斥着异常巨大化的动植物物种，庞大的昆虫是岛上的主要占领者，也是孩子们的最大威胁。为了逃离孤岛回到文明社会，三个孩子展开一系列自救行动，在大自然中不断奋战，数次从巨虫口下逃生。其间与一个行踪不定、敌友莫辨的土著女孩频繁遭遇。随着三个都市少年与土著女孩惊险逃生之旅的深入，孤岛上被密林湮没掩藏了若干世纪的种种谜团也将层层揭开。','1','','0','','1','/dpic/20120725/1028.jpg','437','/donghuapian/437/1.html, /donghuapian/437/2.html, /donghuapian/437/3.html, /donghuapian/437/4.html, /donghuapian/437/5.html, /donghuapian/437/6.html, /donghuapian/437/7.html, /donghuapian/437/8.html, /donghuapian/437/9.html, /donghuapian/437/10.html, /donghuapian/437/11.html, /donghuapian/437/12.html, /donghuapian/437/13.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/086.jpg','http://www.61baobao.com/donghuapian/pic/05/086.jpg','0','三个月以上','13','cntv,909c7632a77443c8b7a4c62ff7706d11|||cntv,0e32f8dfd7ba44759555341112a34e99|||cntv,5b40320a3a044fe4b9f427d34083eeea|||cntv,86096816243f439095bd9805facffd37|||cntv,dec71d13e0d447969825d0e7ed3739d1|||cntv,b4d3163e4bd042c0931c0ddaa7f20640|||cntv,40ee6cfeaa2c4b9c84ad69c5fb3ebc42|||cntv,064196ce579c461c974af5ee0be8dacc|||cntv,47cdad2545cb46239cc031f52e174968|||cntv,d4efdf908b0b4502870797807f05a7ab|||cntv,06d0820250e543eca8b3c874941701f3|||cntv,58f5416490854644bf146c1c45e6c43c|||cntv,d0c3d6622384475fbb6fd0094b97642a|||','0','','0','0','0');");
