E_D("replace into `phome_ecms_game` values('1029','5','0','','','','1','admin','','1','0','1343190149','0','0','0','0','','','1029','0','0','0','0','0','0','星星狐的体验4','1343190149','/spic/20120725/1039.jpg','0','1','1343190149','0','3','1','0','','0','','','667','479','在遥远的魔法森林深处，有一幢美丽的小屋，叫魔法小屋。在魔法小屋的主人——魔法妈妈的引领下，星星狐和他的小伙伴们在这里快乐地成长。我们的主人公就是星星狐——一只活泼、聪明、顽皮的小狐狸。他是一个小小男子汉，虽然有点爱臭美，喜欢别人称赞他，但他热情而善良、勇敢而执着，是一个顶不错的好伙伴。在充满神奇的魔法森林里，常常发生一些奇奇怪怪的事情，这些奇怪的事情让魔法森林的每一天都变成了奇妙的日子。星星狐有一本神奇的愿望书：它能根据星星狐的愿望，让他‘变身’——变成陶艺家、老板、潜水员等各种职业人，去亲身从事各种职业。这一次星星狐又将体验哪些职业呢？星星狐成了陶艺家! 星星狐说好要做一个漂亮的小陶猪作为生日礼物送给朵朵。可从没得到过生日礼物的巫拉拉又来搞破坏了，她将星星狐还没烧制好的小陶猪用雨淋得稀巴烂，害得星星狐没有时间重做，最后只得做一些比较简单的小陶罐。在朵朵的生日聚会上，巫拉拉更是切断了魔法森林的电源想要抢走蛋糕和礼物，就在她要逃走的时候，屋子里却亮了起来。原来是星星狐做的“阳光陶罐”发出了温馨的阳光。','1','','0','','1','/dpic/20120725/1040.jpg','566','/donghuapian/566/1.html, /donghuapian/566/2.html, /donghuapian/566/3.html, /donghuapian/566/4.html, /donghuapian/566/5.html, /donghuapian/566/6.html, /donghuapian/566/7.html, /donghuapian/566/8.html, /donghuapian/566/9.html, /donghuapian/566/10.html, /donghuapian/566/11.html, /donghuapian/566/12.html, /donghuapian/566/13.html, /donghuapian/566/14.html, /donghuapian/566/15.html, /donghuapian/566/16.html, /donghuapian/566/17.html, /donghuapian/566/18.html, /donghuapian/566/19.html, /donghuapian/566/20.html, /donghuapian/566/21.html, /donghuapian/566/22.html, /donghuapian/566/23.html, /donghuapian/566/24.html, /donghuapian/566/25.html, /donghuapian/566/26.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0180.jpg','http://www.61baobao.com/donghuapian/pic/05/0180.jpg','0','三个月以上','26','qiyi,e35ed9ea24444e01bace9e155257c7b5|||qiyi,43c3dfe45b0c4831a07d6fe0d6baa3ed|||qiyi,a56abf0b5f77499494dd2d082cfce624|||qiyi,7156cae66d324b0a914c359480de50f0|||qiyi,53af66568843482f86cdbe7210770114|||qiyi,8128c1aa2a4f43919477b5d69cc00836|||qiyi,540d0679b62448be9a12f9e8af82d415|||qiyi,d03b4c7740dd4d35ad9b1ebeb371d62c|||qiyi,cb5565e460f340329438b90cbcd9825b|||qiyi,8320c340aaac4c638cac83748afbba2c|||qiyi,6ac2472e47da