E_D("replace into `phome_ecms_game` values('1033','5','0','','','','1','admin','','1','0','1343190155','0','0','0','0','','','1033','0','0','0','0','0','0','达菲鸭','1343190155','/spic/20120725/1049.jpg','0','1','1343190155','0','3','1','0','','0','','','667','479','    （版权授权：佳韵社）达菲鸭具有鲜明的性格：泼辣，疯疯癫癫，极为自信。同用心险恶的坏蛋周旋时，它常能使对手自食其果。1939年在动画片《达菲鸭在好莱坞》中，它扮演了一个专横的电影导演，1940年在动画片《达菲鸭在飞行器中》中，它又成了一个胆大冒失的飞行员……只有在和兔八哥的许多较量中，这只语速奇快、喋喋不休的鸭子才时常感到傲气受挫…… ','1','','0','','1','/dpic/20120725/1050.jpg','98','/donghuapian/98/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/89.jpg','http://www.61baobao.com/donghuapian/pic/89.jpg','0','三个月以上','1','sohu,15274|||','0','','0','0','0');");
