E_D("replace into `phome_ecms_game` values('1037','5','0','','','','1','admin','','1','0','1343190159','0','0','0','0','','','1037','0','0','0','0','0','0','红柿子姐弟','1343190159','/spic/20120725/1097.jpg','0','1','1343190159','0','3','1','0','','0','','','667','479','这个故事系列讲述了一对可爱的龙凤胎姐弟：具有非凡能力的天安和天佑，勇斗卡普以及他忠实的走狗，保卫幸福镇的故事。姐姐天安比弟弟天佑早出生一分三十秒，虽然他们具有超人的能力，但仍逃不掉常规7岁孩子应做的事情，比如：做功课、叠被子、打扫房间等等……姐弟俩超级魔力的得来纯属偶然。当他们还是婴儿的时候，在妈妈的实验室里，妈妈本该喂他们奶瓶里的东西，但是妈妈——番茄教授正忙于做实验，没有注意到孩子的爸爸番茄先生却将一些实验用的液体喂给孩子。一时间，“呼”的一声，巨大爆炸，烟散尽后露出两个仍在兴高采烈、咯咯乱笑的孩子，就好象什么都没有发生过。从此，姐弟俩就具有了非凡的能力。天安可以在屋子里飞来飞去，天佑很容易就举起了重物，就象在拿羽毛。','1','','0','','1','/dpic/20120725/1098.jpg','569','/donghuapian/569/1.html, /donghuapian/569/2.html, /donghuapian/569/3.html, /donghuapian/569/4.html, /donghuapian/569/5.html, /donghuapian/569/6.html, /donghuapian/569/7.html, /donghuapian/569/8.html, /donghuapian/569/9.html, /donghuapian/569/10.html, /donghuapian/569/11.html, /donghuapian/569/12.html, /donghuapian/569/13.html, /donghuapian/569/14.html, /donghuapian/569/15.html, /donghuapian/569/16.html, /donghuapian/569/17.html, /donghuapian/569/18.html, /donghuapian/569/19.html, /donghuapian/569/20.html, /donghuapian/569/21.html, /donghuapian/569/22.html, /donghuapian/569/23.html, /donghuapian/569/24.html, /donghuapian/569/25.html, /donghuapian/569/26.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0183.jpg','http://www.61baobao.com/donghuapian/pic/05/0183.jpg','0','三个月以上','26','qiyi,b444a7e238df49d488017aee70fe5016|||qiyi,bdeeb0cb07f644afbb03b5be3ab435f3|||qiyi,950d51721b6c4e889135cfd4bbae69a0|||qiyi,ae793167423e41a89df79b4a7f90562c|||qiyi,c9c82e6941a44e7b9d621ffff5ca95cd|||qiyi,74d241ba907c4f0198191e1a47278b5a|||qiyi,2bc050e855ec4b14bd8fece96330ef2f|||qiyi,e4d0b926192646109693ceef64de952b|||qiyi,477a3ee81a86436587a9b5fdfcf42733|||qiyi,7bafe83593cd4f409497ab6cf9491c64|||qiyi,c49506726f0646e680f42465df56b263|||qiyi,f16807b02db642e08f3115bfe16ddb17|||qiyi,37c519befbf8468d809693fa96396d7d|||qiyi,bd021472765e4a6c9a8201cfde820c04|||