E_D("replace into `phome_ecms_game` values('1047','5','0','','','','1','admin','','1','0','1343190227','0','0','0','0','','','1047','0','0','0','0','0','0','马兰花','1343190227','/spic/20120725/1043.jpg','0','1','1343190227','0','3','1','0','','0','','','667','479','马兰山下住着孪生姐妹俩，姐姐大兰懒惰，妹妹小兰勤劳。小兰嫁给了马兰山上的青年马郎，大兰误会那就是传说中神奇的马兰花。她认为小兰是靠马兰花的力量才过上好日子。大兰背负着害死妹妹的负罪感，经过了风吹雨打、历尽了千难万险，大兰终于得到了马兰花，她终于可以向马兰花许愿，让妹妹活过来了。老狼和老猫也是狂喜万分，但事情却完全不是他们想象的那么简单','1','','0','','1','/dpic/20120725/1044.jpg','735','/donghuapian/735/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/034.jpg','http://www.61baobao.com/donghuapian/pic/07/034.jpg','0','三个月以上','1','cntv,5cff1d083ba34721ae35ea94eca36cf7|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1048','5','0','','','','1','admin','','1','0','1343190227','0','0','0','0','','','1048','0','0','0','0','0','0','没头脑和不高兴电影','1343190227','/spic/20120725/1065.jpg','0','1','1343190227','0','3','1','0','','0','','','667','479','《没头脑和不高兴》动画片拍摄于1962年，讲述了两个孩子，一个叫\\\\\"没头脑\\\\\"，一个叫\\\\\"不高兴\\\\\"。\\\\\"没头脑\\\\\"做起事来丢三拉四，总要出些差错。\\\\\"不高兴\\\\\"总是别别扭扭，你要他往东，他偏往西。别人劝这两个孩子改掉坏脾气，他们都不以为然，为帮他们改正缺点，暂时把他俩变成了大人.....','1','','0','','1','/dpic/20120725/1066.jpg','450','/donghuapian/450/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/098.jpg','http://www.61baobao.com/donghuapian/pic/05/098.jpg','0','三个月以上','1','cntv,759631F4424C4e06970868685C99C905|||','0','','0','0','0');");
